import React from 'react';
import { useParams } from 'react-router-dom';
import '../styles/TaskDetails.css';

const TaskDetails = () => {
  const { id } = useParams();

  return (
    <div>
      <h1>Task Details</h1>
      <p>Task ID: {id}</p>
      <p>Details about the task will be displayed here.</p>
    </div>
  );
};

export default TaskDetails;
